import React from 'react';

const Location = ({ showModal, handleModalClose }) => {
  return (
    <div>
      {showModal && (
        <div className="modal" tabIndex="-1" role="dialog" style={{ display: 'block' }}>
          <div className="modal-dialog" role="document">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">Search Locations</h5>
                <button type="button" className="btn-close" aria-label="Close" onClick={handleModalClose}></button>
              </div>
              <div className="modal-body">
                <form>
                  <input
                    className="form-control"
                    type="text"
                    placeholder="Search Locations"
                  />
                  <button className="btn btn-primary mt-2" id="searchres" type="submit">Search</button>
                </form>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Location;
